function create() {
    this.clockSFX = game.add.audio('clockSFX',0.3);
    this.winSFX = game.add.audio('winSFX',0.3);

	this.firtsTime = false;
	this.currentIndex = 0;
	this.count = 10; 
	this.adStart = false;
	this.itemPriceList = [41.21,16.78,68.09,71.21,15.90,10.24];
	this.itemTimerList = [10,7,8,5,9,6];
    setScene1();
	setScene2();
    setCTA();
}

function setScene1(){
    this.logo = game.add.sprite(this.game.world.centerX, this.game.height*-1.5,'atlas','logo_long.png');
    this.logo.anchor.set(0.5);
    this.logoTween = game.add.tween(this.logo).to({y:this.game.height*0.07}, 1000, Phaser.Easing.Sinusoidal.Out).start();

    this.textTutorial = game.add.text(this.game.width*0.5, this.game.height*0.18, 'WHICH AUCTION WOULD\nYOU WANT TO WIN?', this.textDefault);
    this.textTutorial.anchor.set(0.5);

    this.itemsGroup = this.game.add.group();
    this.itemsPriceGroup = this.game.add.group();
    this.itemsTimerGroup = this.game.add.group();

    for(var i = 1;i <= 6;i++){
    	var timerText = '00:00:';
    	if(i >= 2) timerText = '00:00:0';

    	var itemPrice = game.add.text(this.game.width*0.5, this.game.height*0.25, '$'+this.itemPriceList[i-1], this.textDefault2);
	    itemPrice.anchor.set(0.5);
	 	itemPrice.stroke = '#008ACD';
	    itemPrice.strokeThickness = 2;
	    itemPrice.fontSize = 36;

	    var itemTimer = game.add.text(this.game.width*0.5, this.game.height*0.25, timerText+this.itemTimerList[i-1], this.textDefault2);
	    itemTimer.anchor.set(0.5);
	 	itemTimer.stroke = '#008ACD';
	    itemTimer.strokeThickness = 2;
	    itemTimer.fontSize = 32;

        var item = game.add.sprite(this.game.world.centerX, this.game.height*0.5,'atlas','item'+i+'.png');
        item.scale.set(0);
        item.anchor.set(0.5);
        item.inputEnabled = true;
        item.events.onInputDown.add(chooseItem, this);
        this.itemsGroup.addChild(item);
        this.itemsPriceGroup.addChild(itemPrice);
        this.itemsTimerGroup.addChild(itemTimer);
        game.add.tween(item.scale).to({x:0.35,y:0.35}, 500+(i*200), Phaser.Easing.Sinusoidal.Out).start();
    }
    this.itemsGroup.align(2, 3, 350, 320, Phaser.CENTER);
    this.itemsGroup.x = 0;
    this.itemsGroup.y = this.game.height*0.28;

    this.itemsPriceGroup.align(2, 3, 350, 320, Phaser.CENTER);
    this.itemsPriceGroup.x = 0;
    this.itemsPriceGroup.y = this.game.height*0.15;

    this.itemsTimerGroup.align(2, 3, 350, 320, Phaser.CENTER);
    this.itemsTimerGroup.x = 0;
    this.itemsTimerGroup.y = this.game.height*0.18;

    this.game.time.events.loop(1000,runTimers,this);
    this.game.time.events.add(20000,showCTA,this);
}

