function increaseBid(){    
	this.bidnow.inputEnabled = false;
	this.count = 10;
	this.itemPriceList[this.currentIndex] += 0.01;
	this.bidnow.children[0].fontSize = 50;
	this.textBidnow.setText('You have the\nhighest bid');
	this.timeCount.setText('00:00:'+this.count);
	this.textPrice.setText('$'+this.itemPriceList[this.currentIndex].toFixed(2)); 

	if(this.firtsTime == 0){
		this.firtsTime = 1;

		this.game.time.events.add(3000,function(){
            this.clockSFX.restart("",0,0.3);
            this.newbidderTween.start();
            
            this.game.time.events.add(2500,function(){
                game.add.tween(this.newbidder).to({alpha:0}, 800, Phaser.Easing.Sinusoidal.Out).start();
            });

			this.bidnow.inputEnabled = true;
			this.count = 10;
			this.itemPriceList[this.currentIndex] += 0.01;
			this.bidnow.children[0].fontSize = 80;
			this.textBidnow.setText('BID NOW');
			this.timeCount.setText('00:00:'+this.count);
			this.textPrice.setText('$'+this.itemPriceList[this.currentIndex].toFixed(2)); 
		});
	}
    else if(this.firtsTime == 1)
        this.clockTimer.delay = 500;
}

