function runTimers(){
	for(var i = 0; i < 6;i++){
		this.itemTimerList[i]--;
		this.itemsTimerGroup.children[i].setText('00:00:0'+this.itemTimerList[i]);

		if(this.itemTimerList[i] < 0){
			this.itemTimerList[i] = 10;
			this.itemPriceList[i] += 0.01;
			this.itemsTimerGroup.children[i].setText('00:00:'+this.itemTimerList[i]);
			this.itemsPriceGroup.children[i].setText('$'+this.itemPriceList[i].toFixed(2));
		}
	}
}

function runTimer(){
	this.count--;
	if(this.count <= 0){
        this.clockSFX.stop();
        this.game.time.events.removeAll();
		this.count = 0;
		this.soldOutTween.start();
		this.game.time.events.add(2000,showCTA);
	}
	this.timeCount.setText('00:00:0'+this.count);
}

function showCTA(){
	game.add.tween(this.group).to({alpha:0}, 500, Phaser.Easing.Sinusoidal.Out).start();
	game.add.tween(this.logo).to({alpha:0}, 600, Phaser.Easing.Sinusoidal.Out).start();
	game.add.tween(this.textTutorial).to({alpha:0}, 600, Phaser.Easing.Sinusoidal.Out).start();
    game.add.tween(this.itemsGroup).to({alpha:0}, 600, Phaser.Easing.Sinusoidal.Out).start();
    game.add.tween(this.itemsPriceGroup).to({alpha:0}, 600, Phaser.Easing.Sinusoidal.Out).start();
    game.add.tween(this.itemsTimerGroup).to({alpha:0}, 600, Phaser.Easing.Sinusoidal.Out).start();
	this.CTAbtn.scale.set(1);
	this.logoCTATween.start();
	this.CTAbtnTween.start();
	this.CTAstoreTween.start();
	this.CTAstore2Tween.start();
	this.game.input.onDown.add(onClickDownload,this);
}
